  max-height: $rt-toast-max-height;
  overflow: hidden;
  font-family: $rt-font-family;
  cursor: pointer;
  direction: ltr;
  &--rtl {
    direction: rtl;
  }
  &--dark {
    background: $rt-color-dark;
    color: $rt-text-color-dark;
  }
  &--default {
    background: $rt-color-default;
